^cyan;Prey Information^reset;

Whether you are being eaten by a object predator, or a player transformed into a predator, as prey you will have a HUD in the bottom right, this indicates which directions you can struggle to cause the predator to do something.

For player controlled predators, most struggles are disabled so that player is in full control of their state, but if they are in a state where an escape is available, you may be able to struggle out still, but it is possible for them to disable being able to escape entirely in their settings.

^red;Red^reset;
indicates a direction in which you could escape, such as out the mouth or butt, your prey settings do not impact whether the arrow appears or not, but they do effect whether you can actally escape, a red arrow may indicate an anal vore escape, but if it isn't enabled in your settings, struggling that direction will not do anything.

^blue;Blue^reset;
Indicates a state change, such as making the predator stand up or sit down.

^green;Green^reset;
Indicates a state change, but only for state changes that would bring you closer to a state you can escape from.

^cyan;Cyan^reset;
Indicates a direction that would move you to another location within the predator's body.

^yellow;Yellow^reset;
Indicates a direction that would cause you to get eaten if you're just being held currently.

If you ever need to escape, yet such a thing is currently impossible, that being you're nested inside someone else, or a mean pred isn't letting you out... or something just happened to break, to get out you just need to hold ^green;all four directions^reset; and then press ^green; space^reset;. Only ever use this feature if you absolutely need to!

^cyan;Wheres The Content?^reset;

The content in this mod can be accessed via Auri's Shop, you can find her shop by finding a fireplace in a ruins structure on a lush planet and using it to warp to her shop. If you cannot find such a fireplace, it is likely another mod may have overwritten it spawning, you can use the command ^yellow;/placedungeon sbqGardenFireplace^reset; to place a fireplace at your cursor, or ^yellow;/warp instanceworld:sbqHub^reset; to just warp directly to her shop.


^cyan;Why Can't I Eat This Thing?^reset;

Players, NPCs, Monsters, they all follow the prey enabling rules, and all have different things enabled or disabled by default. By default, randomly generated NPCs can be prey for any action, some special NPCs such as story related ones or outpost shopkeepers/quest givers have being prey disabled, NPCs of the devs also have prey disabled, NPCs of people's OCs may have being prey to some types of vore disabled, or have being prey disabled entirely. Monsters are well, monsters, so by default most sexual vore types will be disabled for them. Players, by default, will have all sexual vore types disabled, they must go into their prey settings menu to enable it if they wish to be prey for that type of vore.

